import "./components/style-elements.css";
import "./components/style-index.css";
import Footer from "./components/Footer";
import ReadyButton from "./components/ReadyButton";
import CarouselDots from "./components/CarouselDots";
import Carousel from "./components/Carousel";
import HowToLists from "./components/HowToLists";
import ArrowDown from "./components/ArrowDown";
import PostHeroTitle from "./components/PostHeroTitle";
import ImagesCont from "./components/ImagesCont";
import HeroBelowSection from "./components/HeroBelowSection";


function App() {
  return (
    <div>
      <header className="main-header sticky">
        <a className="logo-box logo-box--index" href="index.html">
          M<div id="logo-a">ore</div>M<div id="logo-b">ore</div>M
          <div id="logo-c">e</div>
        </a>
        <div className="button-area">
          <button className="main-header-buttons" id="login-button">
            <strong>LOGIN</strong>
          </button>
          <button className="main-header-buttons" id="sign-up-button">
            <strong>SIGN UP</strong>
          </button>
          <a className="about-button" href="about.html">
            ...about
          </a>
        </div>
      </header>
      <main className="index-main">

        <HeroBelowSection></HeroBelowSection>
        <ImagesCont></ImagesCont>
        <PostHeroTitle></PostHeroTitle>
        <ArrowDown></ArrowDown>
        <HowToLists></HowToLists>
        <Carousel></Carousel>
        <CarouselDots></CarouselDots>
        <ReadyButton></ReadyButton>
        <Footer></Footer>
      </main>
    </div>
  );
}

export default App;
